import React, { useState } from 'react'
import { NavDropdown } from 'react-bootstrap';
import Login from './login';

interface IProps {
  initialShow: boolean;
}

const LoginContainer: React.FC<IProps> = ({initialShow}) => {
  const [show, setShow] = useState(initialShow);

  return <>
    <span onClick={() => setShow(true)}>Iniciar sesi√≥n</span>
    <NavDropdown.Item><Login show={show} onHide={() => setShow(false)} /></NavDropdown.Item>
  </>
}

export default LoginContainer;
